import React from 'react';

class BuscarPokemon extends  React.Component {
	constructor( props ) {
		super( props );

        this.state = {
            pokemon: '',
            resultado: {},
            loading: false,
            message: '',
		};
	}
	render() {
		return (
			<div>
				<h2>Buscar Pokemon</h2>				
				<label>
					<input
						type="text"
						value=""
						id="search-input"
						placeholder="Busca un pokemon"
					/>
				</label>
			</div>
		)
	}
}
export default BuscarPokemon;
